import React, { Component } from "react";

export class Explore extends Component {
  constructor(props) {
    super(props);

    const post = [
      {
        id: 1,
        title: "paris",
        desc: "beautiful",
      },
      {
        id: 2,
        title: "chicago",
        desc: "busy",
      },
    ];

    this.state = {};
  }

  render() {
    return (
      <div>
        <h1>Explore</h1>
        {post.map((p) => (
          <Card index={p.id}></Card>
        ))}
      </div>
    );
  }
}

export default Explore;
